import React from 'react'

function ContactCard(name, imgUrl, phone, email) {
  return (
    <div className="contact-card">
      <img src={imgUrl}/>
      <h3>{name}</h3>
      <p>Phone: {phone}</p>
      <p>Email: {email}</p>
    </div>
  )
}

export default ContactCard
